<script>
// This component have to be outside of nuxt router because of SVG refresh bug
export default {
  name: 'hero-image',

  props: {
    isIndex: {
      type: Boolean
    }
  },

  data () {
    return {
      ready: false,
      isLandscape: true,
      isMobile: false,
      skrollr: false,
      isAnimated: false
    }
  },

  watch: {
    '$route' (route) {
      if (this.skrollr && route.name !== 'index') {
        this.skrollr.destroy()
      } else {
        if (route.name === 'index') {
          this.initAnimation()
        }
      }
    }
  },

  beforeMount () {
    this.checkSize()
    window.addEventListener('resize', this.checkSize)
  },

  beforeDestroy () {
    window.removeEventListener('resize', this.checkSize)
  },

  mounted () {
    this.ready = true

    if (this.$route.name === 'index') {
      this.initAnimation()
    }
  },

  methods: {
    initAnimation () {
      this.isAnimated = /iPhone|iPad|iPod|Android/i.test(navigator.userAgent)
      if (!this.isAnimated) {
        this.skrollr = window.skrollr.init()
      }
    },
    checkSize () {
      this.isLandscape = window.innerHeight > window.innerWidth
      this.isMobile = window.innerWidth <= 639
      if (this.skrollr) {
        this.skrollr.refresh()
      }
    },
    mobileShift (x, y) {
      return `transform:translate3d(${this.isMobile ? x : '0px'},${y}, 0px)`
    },
    pyramidPosition () {
      let pos = 0
      if (process.client) {
        let svgH = window.innerHeight
        if (!this.isLandscape && !this.isMobile) {
          svgH = window.innerWidth / 0.653906
          pos = (svgH - window.innerHeight) / 5.5
        }
      }
      return `transform:translate3d(0px,${pos}px, 0px)`
    }
  }
}
</script>

